INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1001, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 0, 1, "春咲 ひより", 1, "お！\nあそこに困ってそうな人発見！", 2, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1002, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 0, 1, "草野 優衣", 1, "大切な人を\n守れるようになりたい…って", 2, 1, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1003, 0, "少しは磨かれると思いますよ。", 0, 0, 0, 1, "士条 怜", 1, "キミに必要な集中力と感性が", 2, 1, "フェンシングを始めてみては？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1004, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 0, 1, "穂高 みそぎ", 1, "今日はなにして遊ぶ？", 2, 1, "ねぇ、にいちゃん！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1006, 0, "私といっしょに…\nいかない？", 0, 0, 0, 1, "風宮 あかり", 1, "ねぇ…", 2, 1, "風宮あかりです");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1007, 0, "食べ物の恨みは怖いのー", 0, 0, 0, 1, "出雲 宮子", 1, "プリンたべたいのー", 2, 1, "出雲宮子なのー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1008, 0, "いいよ。\n見られることは運命さ…", 0, 0, 0, 1, "虹村 雪", 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, "ボクは虹村雪。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1009, 0, "人呼んで「疾風の冥姫」!!", 0, 0, 0, 1, "柊杏奈", 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1010, 0, "ほんまおおきにやわ～♪", 0, 0, 0, 1, "姫宮 真歩", 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1011, 0, "ここで会ったが\n100年目～！", 0, 0, 0, 1, "衣之咲 璃乃", 1, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, "衣之咲璃乃です！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1012, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 0, 1, "柏崎 初音", 1, "ち、超能力って…\n何のことかな～？", 2, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1016, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 0, 1, "美波 鈴奈", 1, "一応カリスマ読モJKやってまっす！", 2, 1, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1017, 0, "でも、沖縄もとってもいいとこさー", 0, 0, 0, 1, "喜屋武 香織", 1, "東京は遊園地みたいなところさー", 2, 1, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1018, 0, "イオちゃんって呼んでね。", 0, 0, 0, 1, "支倉 伊緒", 1, "先生って呼ばれるのは\nくすぐったいから", 2, 1, "支倉伊緒です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1020, 0, "ミミをおいてかないでぇ～", 0, 0, 0, 1, "茜 ミミ", 1, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1021, 0, "ふぇぇぇぇぇん……", 0, 0, 0, 1, "栗林 くるみ", 1, "あの……\nふぇ……", 2, 1, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1022, 0, "なんてありがとうございます！", 0, 0, 0, 1, "風宮 より", 1, "こんな私に貴重な時間を\n割いていただき、", 2, 1, "風宮よりです。\nあああああ！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1023, 0, "私こっち行きたいー\nね、早く早くー", 0, 0, 0, 1, "北条 綾音", 1, "おにいちゃんどこいくの？\nえ？", 2, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1025, 0, "これて何か違う…\nあああすみません！", 0, 0, 0, 1, "天野 すずめ", 1, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1027, 0, "離しませんわ………\n絶対に…!!", 0, 0, 0, 1, "倉石 恵理子", 1, "あなたは…運命の……\n伴侶……", 2, 1, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1028, 0, "…そうでしょ？？", 0, 0, 0, 1, "佐々木 咲恋", 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1029, 0, "あはは、\n私もまだまだだなぁ～", 0, 0, 0, 1, "桜井 望", 1, "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1030, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 0, 1, "ニノン・ジュベール", 1, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, "デケデケデンっ！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1031, 0, "おかしいですね……", 0, 0, 0, 1, "上喜 しのぶ", 1, "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1033, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 0, 1, "野戸まひる", 1, "けんども\nそれには足りないモンが…", 2, 1, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1034, 0, "ちょ\nちょっと一杯飲んできます…！", 0, 0, 0, 1, "綾瀬 ゆかり", 1, "ちょっと緊張しちゃって…", 2, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1036, 0, "これ以上お話しすることは…\nないです！", 0, 0, 0, 1, "氷川 鏡華", 1, "知らない人とは話しちゃいけないので", 2, 1, "氷川鏡華…です");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1038, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 0, 1, "柏崎 栞", 1, "……あ、アラーム。", 2, 1, "柏崎…栞です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1040, 0, "野に咲く花が、\n唯一の話相手です。", 0, 0, 0, 1, "双葉 碧", 1, "私、一人も友達がいなくて……", 2, 1, "ふ、双葉碧です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1042, 0, "そう思っています。", 0, 0, 0, 1, "三角 千歌", 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, "三角千歌です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1043, 0, "う、疑ってすまなかったな…", 0, 0, 0, 1, "安芸 真琴", 1, "あぁ？\nお前のそいつの仲間か？", 2, 1, "安芸真琴だ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1044, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 0, 1, "イリヤ・オーンスタイン", 1, "生けとし生ける全ての者よ！", 2, 1, "わらわこそは夜を総べる者！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1045, 0, "ｌク、クウカに何かご用ですか!?", 0, 0, 0, 1, "遠見 空花", 1, "ぐふふふふ……はっ！", 2, 1, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1046, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 0, 1, "宮坂たまき", 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1048, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 0, 1, "大神 美冬", 1, "それでは早速クエストに…", 2, 1, "大神美冬よ！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1049, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 0, 1, "星野静流", 1, "クエストもバトルも\n掃除も洗濯も", 2, 1, "星野静流だよ！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1050, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 0, 1, "玉泉美咲", 1, "見ての通りの\nセクシー美少女で", 2, 1, "アタシは玉泉美咲。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.4, 1052, 0, "？？？？", 0, 0, 0, 1, "リマ", 1, "？？？？", 2, 1, "？？？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1053, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, 1, "モニカ・ヴァイスヴィント", 1, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1058, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, 1, "ペコリーヌ", 1, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1059, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, 1, "コッコロ", 1, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 1.5, 1060, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, 0, 1, "キャル", 1, "菓子でつろうなどと\n稚拙な策を……", 2, 1, "モニカ・ヴァイスヴィントだ。");
